        super(props);
        this.state=props;
        console.log(this.state)
    }
    render(){
        return(
           <tr>
               <td>{this.state.tutorial_name}</td><td><div className="text-center">25%</div>
      <Progress value="25" /></td>
           </tr>
        )
    }
}
export default Tutorialscore;
